import React from 'react'

function navBar() {
    return (
        <div className="NavBar">
            <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/0/08/Netflix_2015_logo.svg/1920px-Netflix_2015_logo.svg.png" alt="Netflix" />
            
        </div>
    )
}

export default navBar
